VALUES ('8007490031295', 'Fini Grantortello Di Carne', 'Pates fraiches aux œufs farcies avec viande Ingrédients — Pâtes 62%: farine de blé, œufs 20%, semoule de blé dur, eau. Farce 38%: viande de porc cuite (viande de porc 97%, oignon, sel), chapelure (farine de blé, sel), lactosérum, huile de tournesol, fibres végétales, arômes naturels (contient lait), sel, épices, protéines de lait. Peut contenir des traces de fruitsà coque. À consommer jusqu\'au.\' voir la date imprimée. Conditionné sous atmosphère protectrice. À conserver au réfrigérateur à +4/60C. À consommer après cuisson et dans les 3 jours après ouverture. Préparation: cuire les pâtes à l\'eau bouillante salée pendant 3/4 minutes, les égoutter et assaisonner selon le goût. 2 portions. L\'image est pour illustrer le produit.', 'https://static.openfoodfacts.org/images/products/800/749/003/1295/front_fr.4.400.jpg', '5.4', '1.3', '46', '4.5', '', '10', '1', '0.393700787401575', '', '1');

